package com.Evergent.CoreJava.GeneralProgramming;

public class Pattern6 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int cnt=25;
		for(int i=1;i<=5;i++) {
			for(int j=1;j<=5;j++) {
				System.out.print(cnt+" ");
				cnt--;
			}
			System.out.println(" ");
		}

	}

}
